import Layout from '../components/Layout';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee } from '@fortawesome/free-solid-svg-icons'
import { faCannabis } from '@fortawesome/free-solid-svg-icons'

const Index = () => (
    <Layout>
        <>
            <h1>The Menu</h1>
            <div id="icons">
                <div id="coffee">
                    <FontAwesomeIcon icon={faCoffee} height="100px" width="100px" />
                </div>

                <div id="cannabis">
                    <FontAwesomeIcon icon={faCannabis} height="100px" width="100px" />
                </div>
            </div>
            <style jsx>
                {`
               h1 {
                   text-align: center;
                   margin-top: 10px;
               }
               #icons {
                   display: inline-block;
                   color:blue;
               }
               #coffee {
                   margin-left:100px;
               }
               #cannabis {
                   color: green;
               }

               `}
            </style>
        </>
    </Layout>
)

export default Index;
